import math
from math import inf

def calculate_minimum_cost(A, N, M=1000000008):
    dp = [[inf] * 21 for _ in range(N)]
    for i in range(-10, 11):
        dp[0][i + 10] = 1 << abs(i)
    for i in range(1, N):
        for j in range(-10, 11):
            for k in range(-10, 11):
                if math.gcd(A[i - 1] + j, A[i] + k) == 1:
                    dp[i][k + 10] = min(dp[i][k + 10], dp[i - 1][j + 10] + (1 << abs(k))) % M
    ans = inf
    for i in range(-10, 11):
        ans = min(ans, dp[N - 1][i + 10])
    return ans % M

